import React from 'react';
import jobList from '../../../utils/main/section-experience/job-list';

function Jobs() {
  const jobCards = jobList.map((item) => (
    <li key={item.index} className="job-card">
      <article className="card-left">
        <h2>{item.title}</h2>
        <h3>{item.location}</h3>
        <h3>{item.date}</h3>
        <ul className="task-list">
          <li className="task-item">{item.tasks.one}</li>
          <li className="task-item">{item.tasks.two}</li>
          <li className="task-item">{item.tasks.three}</li>
          <li className="task-item">{item.tasks.four}</li>
        </ul>
      </article>
      <img src={item.imageUrl} alt={item.imageAlt} className="card-right" />
    </li>
  ));
  return (
    <ul className="TBD">List</ul>
  );
}

export default Jobs;
